import React from "react";
import logo from "../imges/logo.svg";
const Header = () => {
  return (
    <header>
      <div className="headerFrame">
        <div className="logoDiv">
          <img src={logo} alt="logo" />
          <p>EPICURE</p>
        </div>
        <nav>
          <div className="navButton" onClick={() => {}}>
            Restaurants
          </div>
          <div className="navButton" onClick={() => {}}>
            Chefs
          </div>
        </nav>
        <div></div>
      </div>
    </header>
  );
};
export default Header;
